import * as React from 'react';
import axios from 'axios';

async function Cric() {

  const name = "Shashank Saxena"
  const score = await getscore().then(function(result) {
    console.log("Matches :", result);
    return result;
  });
  console.log("Score :", score.matches);

  return <div>
    <h1>{name}</h1>
  </div>
}

export const getscore = async (): Promise<any> => {
  const endpoint = `https://cricapi.com/api/matches?apikey=UY8BE0Sq46gdOnLNp97cfVa29pA2`;
  const data = await (await fetch(endpoint)).json();
  console.log(data);
  return data;
}

export default Cric;
